interface ToggleProps {
  isOn: boolean
}

function clickToggle(isOn: boolean): boolean {
  let returnValue: boolean = !isOn
  return returnValue
}

function Toggle({ isOn }: ToggleProps) {
  return (
    <div className='toggle-container'>
      <div className={isOn ? "toggle-on" : "toggle-off"} onClick={(isOn) => clickToggle} />
    </div>
  )
}

export default Toggle
